import React, { Component } from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';



import { Container, Card, ListGroup, Button} from 'react-bootstrap';

class Far extends Component {


     handleChange = event => {
        this.setState({ username: event.target.value });
      };


    render() { 
        const notes = [
            'hello i am a first note',
            'i am the second one',
            'i third',
            'yeehawww'    
        ]



        return ( 
        <div>
            <Container fluid>
            <Card
                bg={'info'}
                style={{ width: '18rem' }}
                className='rounded-0 mb-2 text-center'
            >
            <Card.Header>What the world <br></br><b>NEEDS</b><Button mg-auto>Add</Button></Card.Header>
            <Card.Body>
            <Card.Text>
            <ul>
                {notes.map((element) => <li>{element}</li>)}
            </ul>
            </Card.Text>
            </Card.Body>
            </Card>
            </Container>
        </div>
        );
    }
}

export default Far;
